function welcome(){
    document.getElementById("welcome").style.display="block";

function gameover(){
    loop=false;

    var msg="我解救蜘蛛侠"+player_time+"秒，但是蜘蛛侠还是因为吸入雾霾过量而挂掉了！";

    shareTitle=msg;

    document.getElementById("msg").innerHTML=msg;

}

    }
}
function init(){

    //canvas
    canvas_w=630;

    canvas.height=canvas_h;
    canvas.top = 0;
    canvas.left = 0;

    fps=1000/16;
    loop=false;
    loadingRES();
    backTime=0;

    buttonLustTapTime=0;

    canvas.addEventListener('touchstart', function (e) {
        var x= e.clientX;
        var y= e.clientY;
        var touchobj = e.changedTouches[0]; // reference first touch point (ie: first finger)
        startX = parseInt(touchobj.clientX);
        startY = parseInt(touchobj.clientY);
        var window_width=document.querySelector("#myCanvas").scrollWidth;
        var window_height=document.querySelector("#myCanvas").scrollHeight;
        var trueX=startX/(window_width/canvas_w);
        var trueY=startY/(window_height/canvas_h);
        trueX=parseInt(trueX);
        trueY=parseInt(trueY);
        //cars.push([trueX,trueY,126/3,195/3,res_car_4]);
        tap(trueX,trueY);
        e.preventDefault();
    }, false);

    canvas.addEventListener('click', function (e) {
        if (loop) {
            var x= e.clientX;
            var y= e.clientY;
            startX = x;
            startY = y;



            var window_width=document.querySelector("#myCanvas").scrollWidth;
            var window_height=document.querySelector("#myCanvas").scrollHeight;

            var trueX=startX/(window_width/canvas_w);
            var trueY=startY/(window_height/canvas_h);

            if(document.body.clientWidth>640){
                trueX=startX-(document.body.clientWidth-640)/2;
                //trueY=startY;
            }
            if(document.body.scrollTop>960){
                trueY=startY-document.body.scrollTop;
            }

            trueX=parseInt(trueX);
            trueY=parseInt(trueY);
            //cars.push([trueX,trueY,126/3,195/3,res_car_4]);
            tap(trueX,trueY)
            e.preventDefault();
        }
    }, false);

    canvas.addEventListener('touchmove', function (e) {
    }, false);

    canvas.addEventListener('touchend', function (e) {
    }, false);

function restart(){
    if(Date.parse(new Date())-buttonLustTapTime>800) {
        tangetX = 320;
        tangetY = 480;

        win = false;
        player_blood=100;
        speed=5;
        player_time = 0;
        fps = 1000 / 32;
        loopTime = 0;
        player_to = "right";
        makeObjTime = 0;
        getObj=0;
        //
        //document.getElementById("myCanvas").style.display="block";
        document.getElementById("welcome").style.display = "none";
        document.getElementById("loading").style.display = "none";
        document.getElementById("gameover").style.display = "none";
        //
        time = 0;
        objs=new Array();
        //objs.push([0,150,100,100]);
        loop = true;
    }
}

function looping(){

    if(loop){
        //
        loopTime+=fps;
        c.clearRect(0, 0,canvas_w,canvas_h);

        c.drawImage(bg_img,0,0,canvas_w,canvas_h);

        for(i in objs){


            if(objs[i][0]+objs[i][2]/2<tangetX){
                objs[i][0]+=speed;
            }
            if(objs[i][1]+objs[i][3]/2<tangetY){
                objs[i][1]+=speed;
            }
            if(objs[i][0]+objs[i][2]/2>tangetX){
                objs[i][0]-=speed;
            }
            if(objs[i][1]+objs[i][3]/2>tangetY){
                objs[i][1]-=speed;
            }

            var obj_x=objs[i][0]+objs[i][2]/2;
            var obj_y=objs[i][1]+objs[i][3]/2;
            if(obj_x>tangetX-10 && obj_x<tangetX+10){
                if(obj_y>tangetY-10 && obj_y<tangetY+10){
                    player_blood--;
                }
            }

            c.drawImage(obj_img,objs[i][0],objs[i][1],objs[i][2],objs[i][3]);
        }





        //c.clearRect(0, 0,canvas_w,canvas_h);
        //c.drawImage(bg_img,0,0,canvas_w,canvas_h);
        makeObjTime++;
        if(makeObjTime>10){


            var tmp_w=Math.floor(Math.random() * 300)+150;
            //var tmp_h=Math.floor(Math.random() * 300)+150;
            var tmp_x=0;
            var tmp_y=0;


            //top
            tmp_x=Math.floor(Math.random() * 640);
            tmp_y=-1*tmp_w;
            objs.push([tmp_x,tmp_y,tmp_w,tmp_w]);
            //left
            tmp_x=-1*tmp_w;
            tmp_y=Math.floor(Math.random() * 960);
            objs.push([tmp_x,tmp_y,tmp_w,tmp_w]);
            //right
            tmp_x=canvas_w+tmp_w;
            tmp_y=Math.floor(Math.random() * 960);
            objs.push([tmp_x,tmp_y,tmp_w,tmp_w]);
            //bottom
            tmp_x=Math.floor(Math.random() * 640);
            tmp_y=tmp_w+canvas_h;
            objs.push([tmp_x,tmp_y,tmp_w,tmp_w]);

            makeObjTime=0;
        }


        time+=fps;
        if(time==1000){
            time=0;
            player_time++;
        }
        c.font="50px Georgia";
        c.fillStyle="#f00";
        c.fillText(player_time,canvas_w/2-15,60);


        //
        c.fillText(player_blood,10,60);
        if(player_blood<=0){
            gameover();
        }
        //
    }
    //checking res loaded?
    if(resloaded==false){
        if(res_count==2){
            welcome();
            resloaded=true;
        }
    }
}
function tap(trueX,trueY){
    for(i in objs){
        if(trueX>objs[i][0]&&trueX<objs[i][0]+objs[i][2]){
            if(trueY>objs[i][1]&&trueY<objs[i][1]+objs[i][3]){
                getObj++;
                objs.splice(i,1);
            }
        }
    }

}
window.addEventListener('load',init,false);
function initbuttons(){
    document.querySelector("#start").addEventListener('touchstart',restart);
    document.querySelector("#start").addEventListener('click',restart);
    document.querySelector("#restart").addEventListener('touchstart',restart);
    document.querySelector("#restart").addEventListener('click',restart);
    document.querySelector("#link").addEventListener('touchstart',link);
    document.querySelector("#link").addEventListener('click',link);
}
</script>
